import React from "react";
import { DivFeed, Posts, DivCreatePost, DivListPost, DivHeader} from "./Styled-Feed";
import Header from "../../components/header/Header";
import {logog1} from "../../constants/assets/UnionlogoG1.svg" 
const FeedPage = () => {

    const noticiesPosts = [
        "../../constants/assets/UnionlogoG1.svg",
    ];

    return(
        <DivFeed>
            <DivHeader>
            <Header />
            </DivHeader>
            <DivListPost>
                {noticiesPosts.map((post, index) => (
                    <img key={index} src={post} alt={`Post ${index + 1}`}/>
                ))}
            </DivListPost>
        </DivFeed>
    )

}

export default FeedPage;
